import React, { useEffect, useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import AccountDetails from './AccountDetails';

function Header() {


    return (
        <>
            <header>
                <div class="logo">
                    <a href="#" data-ajax="sites" class="">
                        <img class="logo-white" src="https://huberway.it/assets/imgs/logo/huberway_.webp" />
                    </a>
                </div>
                <div class="menu">
                    <ul>
                        <li>
                            <a class="" href="#" data-ajax="community"><i class="fal fa-chart-network"></i> Community</a>
                        </li>
                        <li>
                            <a class="" href="#" data-ajax="teams"><i class="fal fa-users"></i> Teams</a>
                        </li>
                    </ul>
                </div>
                <AccountDetails />

            </header>
        </>
    );

}


export default Header;
